import flowerTulip from '../../assets/icons/icon_flower_tulip.svg';
import sparkle from '../../assets/icons/icon_sparkle.svg';
import smiley from '../../assets/icons/icon_smiley.svg';

const benefitsData = [
  {
    img: flowerTulip,
    description: '10+ Years in Florals',
  },
  {
    img: sparkle,
    description: 'Handcrafted Quality',
  },
  {
    img: smiley,
    description: '15K+ Happy Customers',
  },
];
export default benefitsData;
